<style>
html,body {{

}}
#panel {{

}}

}}

.slider-wrap {{

}}

#savingsBox {{

}}
#savingsBox h4 {{ margin:4px 0 6px 0; font-size:14px; color:#333; }}
#savingsValue {{ font-size:22px; font-weight:bold; color:#27ae60; }}
</style>
</head>

legend.selectAll("rect").data(legendData).enter()
  .append("rect")
  .attr("x", (d, i) => i * 180)
  .attr("y", 0)
  .attr("width", 14)
  .attr("height", 14)
  .attr("fill", d => d.color);

legend.selectAll("text").data(legendData).enter()
  .append("text")
  .attr("x", (d, i) => i * 180 + 20)
  .attr("y", 12)
  .text(d => d.label);

// Groups for dynamic bars and text
const barGroup = svg.append("g");
const pctGroup = svg.append("g");

// Calculate metrics based on Telco cutoff
function calcMetrics(tCut) {{
  const total = rawData.length;

  function summary(fn) {{
    const sub = rawData.filter(fn);
    const accepted = sub.length;
    const defaults = sub.filter(d => d["Good/Bad Flag"] === 1).length;
    return {{ accepted, defaults }};
  }}

  const bank = summary(d => d["Bank Internal Score"] <= bankCut);
  const telco = summary(d => d["FinScore Telco"] >= tCut);
  const combined = summary(d => d["Bank Internal Score"] <= bankCut && d["FinScore Telco"] >= tCut);
  const filteredShare = rawData.filter(d => d["Bank Internal Score"] <= bankCut && d["FinScore Telco"] < tCut).length / total;

  function sections(summaryObj, extra={{}}) {{
    const good = summaryObj.accepted - summaryObj.defaults;
    const bad = summaryObj.defaults;
    const base = {{ good: good / total, bad: bad / total }};
    return Object.assign(base, extra);
  }}

  const secBank = sections(bank);
  const secTelco = sections(telco);
  const secComb = sections(combined, {{ filtered: filteredShare }});

  secBank.reject = 1 - (secBank.good + secBank.bad);
  secTelco.reject = 1 - (secTelco.good + secTelco.bad);
  secComb.reject = 1 - (secComb.good + secComb.bad + secComb.filtered);

  const baseDef = bank.accepted ? bank.defaults / bank.accepted : 0;
  const combDef = combined.accepted ? combined.defaults / combined.accepted : 0;
  const saved = (baseDef - combDef) * pesoPerLoan;

  return {{
    sections: [secBank, secTelco, secComb],
    acceptRates: [secBank.good + secBank.bad, secTelco.good + secTelco.bad, secComb.good + secComb.bad],
    defaultRates: [
      bank.accepted ? bank.defaults / bank.accepted : 0,
      telco.accepted ? telco.defaults / telco.accepted : 0,
      combined.accepted ? combined.defaults / combined.accepted : 0
    ],
    savedPerApp: saved
  }};
}}

function draw(tCut) {{
  const m = calcMetrics(tCut);
  barGroup.selectAll("*").remove();
  const keys = ["good", "bad", "filtered", "reject"];

  m.sections.forEach((bar, i) => {{
    let xCurr = barX;
    keys.forEach(k => {{
      const w = (bar[k] || 0) * barWidth;
      if (w <= 0) return;
      barGroup.append("rect")
        .attr("x", xCurr)
        .attr("y", barY + i * barSpacing)
        .attr("width", w)
        .attr("height", barHeight)
        .attr("fill", schemes[k]);
      xCurr += w;
    }});
  }});

  pctGroup.selectAll("*").remove();
  m.acceptRates.forEach((acc, i) => {{
    const def = m.defaultRates[i] * 100;
    pctGroup.append("text")
      .attr("x", barX + barWidth + 10)
      .attr("y", barY + i * barSpacing + barHeight / 2 + 4)
      .attr("class", "percent-text")
      .text(`A: ${{(acc*100).toFixed(1)}}%  D: ${{def.toFixed(1)}}%`);
  }});

  document.getElementById("savingsValue").textContent = "₱ " + Math.round(m.savedPerApp).toLocaleString();
}}

// UI controls
const slider = document.getElementById("telcoSlider");
const sliderLabel = document.getElementById("sliderVal");
slider.addEventListener("input", () => {{
  sliderLabel.textContent = slider.value;
  draw(+slider.value);
}});

let playing = false, interval;
document.getElementById("playBtn").addEventListener("click", function() {{
  playing = !playing;
  this.textContent = playing ? "Pause" : "Play";
  if (playing) {{
    interval = setInterval(() => {{
      let v = (+slider.value + 1) % 11;
      slider.value = v;
      sliderLabel.textContent = v;
      draw(v);
    }}, 1600);
  }} else {{
    clearInterval(interval);
  }}
}});

draw(+slider.value);
</script>
</body>
</html>
